      "text": "  Rough DraftThis is a super simple/101/beginner/crash course/for dummies guide to help out the utterly confused. In this section we will explainFirst.What is GitHub?GitHub is a web service that hosts your project folder (or  repository/repo), just like Dropbox, it’s in their cloud/serverGitHub uses this software called Git,ForkingProsKeeps branches separated by userReduces clutter in the primary repositoryYour team process reflects the outside contributor processConsMakes it more difficult to see all of the branches that are active (or inactive, for that matter)Collaborating on a branch is trickier (the fork owner needs to add the person as a collaborator)You need to understand the concept of multiple remotes in GitRequires additional mental bookkeepingThis will make the workflow more difficult for people who aren’t super comfortable with GitBranchingProsKeeps all of the work being done around a project in one placeAll collaborators can push to the same branch to collaborate on itThere’s only one Git remote to deal withConsBranches that get abandoned can pile up more easilyYour team contribution process doesn’t match the outside contributor process",
