      "title": "Installation Instructions",
      "text": "This section details how to edit locally on your desktop.We recommend you use GitHub Desktop as a Git Client; available for MacOS and Windows, and Atom as a text editor; available for MacOS, Windows and Linux. See our guides on using Atom and [using GitHub Desktop].    Note: Recommended software is really recommendable  To simplify things, all of our tutorials are with our recommended software and packagesSome of these steps require that you use a Terminal, which is a direct line (a command line) with your computer. If you are a first-time user, don’t be intimidated, it is as easy as copy-paste!  Install ruby and (MacOS users can skip this step.2.1 Install mpapis public key    gpg --keyserver hkp://keys.gnupg.net --recv-keys 409B6B1796C275462A1703113804BB82D39DC0E3       Install rvmrvm installed  2.2 Install RVM stable with ruby:    \curl -sSL https://get.rvm.io | bash -s stable --ruby    Clone the repository          GitHub: click clone repository to GitHub Desktop      Desktop: click + and select clone. sign in and look for the repository. if yiu are a member you have write access to it. if not, yiu will have to fork it.Go to the repository and click clone on GitHub Desktop.      Terminal:git clone https://github.com/DIYbiosphere/sphere.dir.git        Open the repository root folder          Desktop: Right click on the repository andor drag the folder into your terminal (mac users)      Terminal:cd \YourFilePath\sphere.dir            Install dependencies using [Bundler]Terminal: first install bundlergem install bundlerthen install dependenciesTerminal:    bundler install     Start Jekylljekyll serveAdditional InformationFrontendThe views logic is done using JQuery.All the initiatives are stored in a single json file:initiatives.jsonThe main SCSS content is in the /css folder. and as you can see there are @importstatements that reference other files located in the /_sass folder. This allowsto have a modular and cleaner design.  You don’t need to do anything to compile sass, Jekyll take’s care of that.Continuous IntegrationThe project is integrated with Travis-CI, so everytime someone pushes to the master branch of therepository,Travis builds the site using Jekyll and push it to thegh-pages branch.Mac users  Install all the command line tools          Copy the following command line      Paste in your terminalxcode-select — install      A popup window will appear, select install. And you are done2.Install dependencies using bundler        Draft[using Github Desktop]:[file icons]: https://atom.io/packages/file-icons[pigments]: https://atom.io/packages/pigments[todo-show]: https://atom.io/packages/todo-show[atom beautify]: https://atom.io/packages/atom-beautifymerge-conflicts[Markdown-writer for atom]: https://atom.io/packages/markdown-writer[Markdown TOC]: https://atom.io/packages/markdown-toc[Language-liquid]: https://atom.io/packages/language-liquid[Bundler]: http://bundler.io/",
