      "title": "Adding a New Entry for Members",
      "text": "  DraftThis is the tutorial (6 steps) to add a new entry for members. To edit an existing entry go to our editing tutorial. Keep a look out for our helpful hints!Tutorial for non-members is 7 steps and for team members (managers, editors) is 4 steps. Learn more about our development community    Important:  Before you begin, you should:  Have a GitHub account, abide by our Code of Conduct, and agree to our Copyright Terms.  In the editable branch of the repository, open the _database folder and choose a class folder for your new entry and Create new file named ‘EntryName-ZZ.md’. Learn more about our classification of entries and naming convention.  Copy and paste entry template  Fill in your entry  To save your changes Commit changes. Don’t forget to add in a subject line.  When you are ready to merge your changes to the original repository Submit a Pull Request (PR). In the subject line write “Add new entry: [InitiativeName]” Don’t forget to add a title and in the comments specify if it’s your entry or not, and if a manager (contact user for that entry) has been established.  Approve your PR once it passes the internal checks and merge your changes to the original database.Rejoice! your entry is now part of the DIYbiosphere database! :clap: :clap:Thank you for your contribution! :heart:",
