      "text": "  DraftThroughout our documentation you may find the following hint boxes. They are meant to be helpful. Here they are explained:    Important:  Make sure to read this!  Be aware of these messages as they are essential messages to avoid making mistakes or creating bugs in the code    Note: You should also know...  These messages further explain information or sometimes make disclaimers    Tip: Recommendations for you   These are tips and tricks to make contributing easier or to become a master contributor  TLDR: Too Long; Didn&#39;t Read  Skip all that &quot;long&quot; text and read a super short summary    ELI5: Explain Like I&#39;m Five: Don&#39;t Panic!  Super simpler explanations of &quot;complex&quot; topics",
