      "title": "Overview of the DIYbiosphere",
      "text": "In this section we give a general overview of the entire project by answering some questions.**_What is it?_**The DIYbiosphere is a participatory project to create a database of Do-It-Yourself Biology (DIYbio) initiatives from all over the world.**_What is the purpose?_**One is to have a shared and common platform for the DIYbio community; to increase visibility of initiatives and connect people and ideas in all its possibilities. Two is to gather data about the DIYbio community; to map and visualize it in all its diversity across time and space in the hopes that we may learn more about the movement and its futures.**_How did it start?_**The project was proposed as a way to gather and share the rough data on DIYbio labs being collected by PhD student Gabriela Sanchez (@sabgaby) as part of her research. The project was backed by the [Citizen Sciences] research team at the University of Geneva and by the [DIYbio.org] network.**_What does it contribute?_**The database will replace the list of DIYbio labs indexed in the [Local] section in the DIYbio.org website as a more accurate and distributed way of cataloguing DIYbio labs and other initiatives. We also envision the project as a reference point for journalists, academics, governmental agencies, and so on.**_How is it organized?_**The entries of database is divided into eight collections: Projects, Startups, Labs, Incubators, Groups, Networks, Events, and Others. You can review our [classification of entries].**_How does it work?_**The database functions similar to a wiki, with descriptive content and data displayed in a box, but we use [GitHub Pages] instead to host and build the content into the website from simple text files using [Markdown] syntax and [Jekyll]&#39;s liquid language. If you want to get technical your can read more in our [Development] section.**_How is it participatory?_**The project is completely open(-source); anyone can access the database on our website: [sphere.diybio.org], and contribute to it in our repository: [DIYbiosphere/sphere.dir] on GitHub. The project relies on the work of volunteer contributors to maintain the database (write entries) and manage the development of the project. The development is directed by members of the [DIYbiosphere organization] in GitHub. [Join in] and get involved! :dancers:**_Who participates?_**We expect that individuals from the DIYbio community will be the main users and contributors of the project. However, we also believe the database will be of interest to DIYbio supporters and followers.**_How can you participate?_**You can _use_ the database, search for DIYbio initiatives, learn about/from them, or connect with them. You can also _contribute_ by [adding] an entry for your own initiative or another you know of, [editing] an existing entry, or even tackling one of our [issues].**_Where do you start?_**See our [Getting Started] guide to kickstart you into _using_ and _contributing_ to the project See our [Contributing Guide] for how to submit issues, and pull-requests. We also have have an [ELI5 guide] (Explain Like I&#39;m 5) for the utterly confused.**_Where can you learn more?_**In our _Documentation_ section. Learn how the project is managed, follow our updates, or check out our guides and tutorials for contributing.[DIYbiosphere organization]: https://github.com/DIYbiosphere[join in]: /help/contributing/#apply-for-membership[sphere.diybio.org]: http://sphere.diybio.org/[DIYbiosphere/sphere.dir]: https://github.com/DIYbiosphere/sphere.dir[adding]: help/tutorials/add-entry/[editing]: help/tutorials/edit-entry/[issues]: https://github.com/DIYbiosphere/sphere.dir/issues[Getting Started]: /help/getting-started/[Citizen Sciences]: http://citizensciences.net/[DIYbio.org]: https://diybio.org/[Local]: https://diybio.org/local/[GitHub Pages]: https://pages.github.com/[Markdown]: https://guides.github.com/features/mastering-markdown/[Jekyll]: https://jekyllrb.com/[Development]: /help/basics/#development[defining collections]: /help/basics/[ElI5 Guide]: /help/eli5-guide/[Contributing Guide]: /help/contributing/",
      "url": "/about/overview/",
      "tags": ""
